DROP TABLE IF EXISTS `land_block`;
CREATE TABLE `land_block` (
  `id` varchar(32) NOT NULL COMMENT 'ID',
  `name` varchar(100) DEFAULT NULL COMMENT '地块名称',
  `type` varchar(20) DEFAULT NULL COMMENT '地块类型',
  `latitudeAndLongitude` varchar(1024) DEFAULT NULL COMMENT '经纬度',
  `parentId` varchar(32) DEFAULT NULL COMMENT '地块父ID',
  `level` int(11) DEFAULT NULL COMMENT '地块等级',
  `hasChild` int(11) DEFAULT NULL COMMENT '是否有子地块',
  `path` text COMMENT '当前地块全路径',
  `includeIds` text COMMENT '所有子地块与自身',
  `jsonData` text COMMENT '地块数据',
  `showStyle` text COMMENT '显示样式',
  `status` int(11) DEFAULT NULL COMMENT '地块状态',
  `orderNo` int(11) DEFAULT NULL COMMENT '地块排序',
  `addTime` datetime DEFAULT NULL COMMENT '添加时间',
  `modifyTime` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

